    document.getElementById("editPlatformDiv").style.display = "none";
    document.getElementById("platformDiv").style.display = "block";
    console.log(document.getElementById("platformInput").value);

    var result = [document.getElementById("textarea").value, document.getElementById("platformInput").value];

    
    return result;

}

export function editText(){

